import HallRow from '../HallRow';

function edly()
{
    return (
        <div className='edly'>
            <div className='section-1'>
                <HallRow totalSeats={4} startSeatNum={11} />
                <HallRow totalSeats={4} startSeatNum={11} />
            </div>
            <div className='section-2'>
                <HallRow totalSeats={5} startSeatNum={11} />
                <HallRow totalSeats={5} startSeatNum={11} />
            </div>
        </div>
    );
}

export default edX;
